from functools import lru_cache


@lru_cache(maxsize=None)
def uwu(x, y, ans):
    if not x:
        return ans
    now = uwu(x // y, y, ans + 1) if not x % y else 324342334204334
    return min(uwu(x - 1, y, ans + 1), now)


