def max_even_sum(n, nums):
    even_nums = [num for num in nums if num % 2 == 0]
    odd_nums = [num for num in nums if num % 2 != 0]

    total_sum = sum(nums)
    if total_sum % 2 != 0: 
        if even_nums: 
            total_sum -= min(odd_nums)
        else: 
            total_sum -= sum(sorted(odd_nums)[:2])
    return total_sum
