    position = 0
    flowers = set()
    drawn_flower = False

    for _ in range(k):
        position += a
        if position < 0:
            position -= b
        else:
            position += b

        if position in flowers:
            drawn_flower = True
        else:
            flowers.add(position)

    return len(flowers) if not drawn_flower else len(flowers) - 1


