    best_surname = surname
    n = len(surname)
    for i in range(n):
        for j in range(i + 1, n):
            new_surname = list(surname)
            new_surname[i], new_surname[j] = new_surname[j], new_surname[i]
            new_surname = ''.join(new_surname)

            if new_surname < best_surname:
                best_surname = new_surname

    return best_surname

