def min_time_to_eat_candies(n, k, s, candies):
    low, high = 0, sum(candies)
    answer = float('inf')
    while low <= high:
        mid = (low + high) // 2
        req_persons = 1
        current_load = 0
        for candy in candies:
            if current_load + candy > mid:
                req_persons += 1
                current_load = candy
            else:
                current_load += candy
        if req_persons <= k:
            answer = min(answer, mid)
            high = mid - 1
        else:
            low = mid + 1
    return (answer + s - 1) // s
