def number_game(n, numbers):
    my_sum = 0 
    your_sum = 0  


    left = 0
    right = n - 1

    turn = 0 

    while left <= right:
        if turn == 0:  
            if numbers[left] > numbers[right]:
                my_sum += numbers[left]
                left += 1
            else:
                my_sum += numbers[right]
                right -= 1
        else:  
            if numbers[left] > numbers[right]:
                your_sum += numbers[left]
                left += 1
            else:
                your_sum += numbers[right]
                right -= 1

        turn = 1 - turn  

    return (my_sum, your_sum)



