def calculate_min_cars(x, y, z):
    cars_ego = x
    cars_collectivist = y // 3
    rem = y % 3
    remaining_z = z

    if y > 0:
        if rem == 1:
            if remaining_z >= 2:
                cars_collectivist += 1
                remaining_z -= 2
            else:
                return -1
        elif rem == 2:
            if remaining_z >= 1:
                cars_collectivist += 1
                remaining_z -= 1
            else:
                return -1

    cars_z = (remaining_z + 2) // 3

    total_cars = cars_ego + cars_collectivist + cars_z
    return total_cars

