import math

def can_divide(candies, n, k, max_time):
    current_sum = 0
    count = 1  
    for candy in candies:
        if current_sum + candy > max_time:
            count += 1  
            current_sum = candy
            if count > k:  
                return False
        else:
            current_sum += candy
    return True

def find_minimum_time(candies, n, k, s):
    low = max(candies) 
    high = sum(candies) 
    result = high

    while low <= high:
        mid = (low + high) // 2
        if can_divide(candies, n, k, mid):
            result = mid
            high = mid - 1
        else:
            low = mid + 1

    return math.ceil(result / s)

