def f1(candy, max_sum, k):
    current_sum = 0
    requered = 1
    for num in candy:
        current_sum += num
        if current_sum > max_sum:
            requered += 1
            current_sum = num
            if requered > k:
                return False
    return True

def split_c(candy, k):
    left, right = max(candy), sum(candy)
    answer = right
    while left <= right:
        mid = (left + right) // 2
        if f1(candy, mid, k):
            answer = mid
            right = mid - 1
        else:
            left = mid + 1
    return answer

